import React, { Component } from 'react';
import { connect } from "react-redux";
import { clearVids } from '../actions/actions';
import { bindActionCreators } from 'redux';

class SearchList extends Component {

    render() {
        return (
            <div>
                <ul className="list-unstyled">
                    {this.props.search.map((elem, index) => {
                        // return <li className=" col-md-2 mb-5">
                        //     <div className="p-2 thumbDiv">
                        //         <div className="thumbPlay"><i class="fa fa-play fa-2x" aria-hidden="true"></i></div>
                        //         <img width="100%" src={elem.snippet.thumbnails.high.url} alt="" />
                        //         <small className="font-weight-bold thumbTitle text-white">{elem.snippet.title}</small>
                        //     </div>

                        // </li>
                        return <li>
                            <div className="border text-truncate shadow border-muted p-2 m-3" >
                                <img width="150" height="100" src={elem.snippet.thumbnails.default.url} alt="" />
                                <span className="ml-2 font-weight-bold">{elem.snippet.title}</span>
                            </div>
                        </li>
                    }
                    )}
                </ul>
            </div>
        )
    }
    componentDidMount() {
        this.props.clearVids()
        console.log("load hone ke baad", this.props)
    }
}

const mapStateToProps = (state) => {
    console.log("searchpage state", state)
    return {
        search: state.video.search
    }
}

const mapDispatchToProps = (dispatch) => {
    return bindActionCreators({
        clearVids
    }, dispatch)
}

export default connect(mapStateToProps, mapDispatchToProps)(SearchList)
